import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 32.1-353 Rights and responsibilities.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-353.md","filePath":"vacode/32.1-353.md"}'),r={name:"vacode/32.1-353.md"},n=i('<h1 id="§-32-1-353-rights-and-responsibilities" tabindex="-1">§ 32.1-353 Rights and responsibilities. <a class="header-anchor" href="#§-32-1-353-rights-and-responsibilities" aria-label="Permalink to &quot;§ 32.1-353 Rights and responsibilities.&quot;">​</a></h1><p>This chapter shall not be construed as creating any legally enforceable right or entitlement to benefits under the Family Access to Medical Insurance Security Plan under Title XXI of the Social Security Act, as amended, on the part of any person or any right or entitlement to participation. The Department of Medical Assistance Services shall enroll applicants into the Family Access to Medical Insurance Security Plan under Title XXI to the extent funds are made available or as directed by the appropriation act. The Family Access to Medical Insurance Security Plan and any benefits provided thereunder shall not be assistance or public assistance pursuant to Chapter 5 (§ <a href="http://law.lis.virginia.gov/vacode/63.2-500/" target="_blank" rel="noreferrer">63.2-500</a> et seq.) of Title 63.2.</p><p>1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0679" target="_blank" rel="noreferrer">679</a>; 2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0824" target="_blank" rel="noreferrer">824</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0848" target="_blank" rel="noreferrer">848</a>.</p>',3),s=[n];function o(l,c,d,p,h,_){return t(),a("div",null,s)}const u=e(r,[["render",o]]);export{g as __pageData,u as default};
